import { createTheme } from "@material-ui/core";

export const themes = createTheme({
    palette: {
        primary: {
            //red
            background: '#397367',
            //maroon
            bg1: '#63CCCA',
            //white
            text: '#FFFFFF',
        },
        secondary: {
            //gray
            main: '#5DA399',

            temp:'#4285C',
        },
        background:{
            //gray
            main: '#35393C',
        }
    },
});
